import React from 'react';
import { Container, Box, Tabs, Tab } from '@material-ui/core';

export class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value: "Home"
    }
  }

  handleChange(event, newValue){
    this.setState(newValue);
  }

  render() {
    return (
      <Container
      maxWidth={false}
      disableGutters={true}
      bgcolor="#90a4ae">
        <Box
        color="white"
        bgcolor="#b0bec5"
        padding="20%">
          <Tabs
          centered
          indicatorColor="primary"
          textColor="primary">
            <Tab label="Coderals" />
            <Tab label="Apps" />
            <Tab label="Privacy Policy" />
          </Tabs>
        </Box>
      </Container>
    );
  }
}
